B.Cx=new A.kf("Datenschutzerkl\xe4rung",null)
B.SA=new A.x("Wir freuen uns sehr \xfcber Ihr Interesse an unserem Unternehmen. Datenschutz hat einen besonders hohen Stellenwert f\xfcr die Gesch\xe4ftsleitung der Raumunikate Ina Kaiser. Eine Nutzung der Internetseiten der Raumunikate Ina Kaiser ist grunds\xe4tzlich ohne jede Angabe personenbezogener Daten m\xf6glich. Sofern eine betroffene Person besondere Services unseres Unternehmens \xfcber unsere Internetseite in Anspruch nehmen m\xf6chte, k\xf6nnte jedoch eine Verarbeitung personenbezogener Daten erforderlich werden. Ist die Verarbeitung personenbezogener Daten erforderlich und besteht f\xfcr eine solche Verarbeitung keine gesetzliche Grundlage, holen wir generell eine Einwilligung der betroffenen Person ein.",null,null,null,null,null,null)
B.Sn=new A.x("Die Verarbeitung personenbezogener Daten, beispielsweise des Namens, der Anschrift, E-Mail-Adresse oder Telefonnummer einer betroffenen Person, erfolgt stets im Einklang mit der Datenschutz-Grundverordnung und in \xdcbereinstimmung mit den f\xfcr die Raumunikate Ina Kaiser geltenden landesspezifischen Datenschutzbestimmungen. Mittels dieser Datenschutzerkl\xe4rung m\xf6chte unser Unternehmen die \xd6ffentlichkeit \xfcber Art, Umfang und Zweck der von uns erhobenen, genutzten und verarbeiteten personenbezogenen Daten informieren. Ferner werden betroffene Personen mittels dieser Datenschutzerkl\xe4rung \xfcber die ihnen zustehenden Rechte aufgekl\xe4rt",null,null,null,null,null,null)
B.TT=new A.x("Die Raumunikate Ina Kaiser hat als f\xfcr die Verarbeitung Verantwortlicher zahlreiche technische und organisatorische Ma\xdfnahmen umgesetzt, um einen m\xf6glichst l\xfcckenlosen Schutz der \xfcber diese Internetseite verarbeiteten personenbezogenen Daten sicherzustellen. Dennoch k\xf6nnen Internetbasierte Daten\xfcbertragungen grunds\xe4tzlich Sicherheitsl\xfccken aufweisen, sodass ein absoluter Schutz nicht gew\xe4hrleistet werden kann. Aus diesem Grund steht es jeder betroffenen Person frei, personenbezogene Daten auch auf alternativen Wegen, beispielsweise telefonisch, an uns zu \xfcbermitteln.",null,null,null,null,null,null)
B.Ss=new A.x("1. Begriffsbestimmungen",null,null,null,null,null,null)
B.U7=new A.x("Die Datenschutzerkl\xe4rung der Raumunikate Ina Kaiser beruht auf den Begrifflichkeiten, die durch den Europ\xe4ischen Richtlinien- und Verordnungsgeber beim Erlass der Datenschutz-Grundverordnung (DS-GVO) verwendet wurden. Unsere Datenschutzerkl\xe4rung soll sowohl f\xfcr die \xd6ffentlichkeit als auch f\xfcr unsere Kunden und Gesch\xe4ftspartner einfach lesbar und verst\xe4ndlich sein. Um dies zu gew\xe4hrleisten, m\xf6chten wir vorab die verwendeten Begrifflichkeiten erl\xe4utern.",null,null,null,null,null,null)
B.S3=new A.x("Wir verwenden in dieser Datenschutzerkl\xe4rung unter anderem die folgenden Begriffe:",null,null,null,null,null,null)
B.SE=new A.x("a)    personenbezogene Daten",null,null,null,null,null,null)
B.Sz=new A.x('Personenbezogene Daten sind alle Informationen, die sich auf eine identifizierte oder identifizierbare nat\xfcrliche Person (im Folgenden "betroffene Person") beziehen. Als identifizierbar wird eine nat\xfcrliche Person angesehen, die direkt oder indirekt, insbesondere mittels Zuordnung zu einer Kennung wie einem Namen, zu einer Kennnummer, zu Standortdaten, zu einer Online-Kennung oder zu einem oder mehreren besonderen Merkmalen, die Ausdruck der physischen, physiologischen, genetischen, psychischen, wirtschaftlichen, kulturellen oder sozialen Identit\xe4t dieser nat\xfcrlichen Person sind, identifiziert werden kann.',null,null,null,null,null,null)
B.U_=new A.x("b)    betroffene Person",null,null,null,null,null,null)
B.TL=new A.x("Betroffene Person ist jede identifizierte oder identifizierbare nat\xfcrliche Person, deren personenbezogene Daten von dem f\xfcr die Verarbeitung Verantwortlichen verarbeitet werden.",null,null,null,null,null,null)
B.Uh=new A.x("c)    Verarbeitung",null,null,null,null,null,null)
B.RO=new A.x("Verarbeitung ist jeder mit oder ohne Hilfe automatisierter Verfahren ausgef\xfchrte Vorgang oder jede solche Vorgangsreihe im Zusammenhang mit personenbezogenen Daten wie das Erheben, das Erfassen, die Organisation, das Ordnen, die Speicherung, die Anpassung oder Ver\xe4nderung, das Auslesen, das Abfragen, die Verwendung, die Offenlegung durch \xdcbermittlung, Verbreitung oder eine andere Form der Bereitstellung, den Abgleich oder die Verkn\xfcpfung, die Einschr\xe4nkung, das L\xf6schen oder die Vernichtung.",null,null,null,null,null,null)
B.Us=new A.x("d)    Einschr\xe4nkung der Verarbeitung",null,null,null,null,null,null)
B.RV=new A.x("Einschr\xe4nkung der Verarbeitung ist die Markierung gespeicherter personenbezogener Daten mit dem Ziel, ihre k\xfcnftige Verarbeitung einzuschr\xe4nken.",null,null,null,null,null,null)
B.SF=new A.x("e)    Profiling",null,null,null,null,null,null)
B.RU=new A.x("Profiling ist jede Art der automatisierten Verarbeitung personenbezogener Daten, die darin besteht, dass diese personenbezogenen Daten verwendet werden, um bestimmte pers\xf6nliche Aspekte, die sich auf eine nat\xfcrliche Person beziehen, zu bewerten, insbesondere, um Aspekte bez\xfcglich Arbeitsleistung, wirtschaftlicher Lage, Gesundheit, pers\xf6nlicher Vorlieben, Interessen, Zuverl\xe4ssigkeit, Verhalten, Aufenthaltsort oder Ortswechsel dieser nat\xfcrlichen Person zu analysieren oder vorherzusagen.",null,null,null,null,null,null)
B.S9=new A.x("f)    Pseudonymisierung",null,null,null,null,null,null)
B.Uq=new A.x("Pseudonymisierung ist die Verarbeitung personenbezogener Daten in einer Weise, auf welche die personenbezogenen Daten ohne Hinzuziehung zus\xe4tzlicher Informationen nicht mehr einer spezifischen betroffenen Person zugeordnet werden k\xf6nnen, sofern diese zus\xe4tzlichen Informationen gesondert aufbewahrt werden und technischen und organisatorischen Ma\xdfnahmen unterliegen, die gew\xe4hrleisten, dass die personenbezogenen Daten nicht einer identifizierten oder identifizierbaren nat\xfcrlichen Person zugewiesen werden.",null,null,null,null,null,null)
B.TA=new A.x("g)    Verantwortlicher oder f\xfcr die Verarbeitung Verantwortlicher",null,null,null,null,null,null)
B.Ts=new A.x("Verantwortlicher oder f\xfcr die Verarbeitung Verantwortlicher ist die nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle, die allein oder gemeinsam mit anderen \xfcber die Zwecke und Mittel der Verarbeitung von personenbezogenen Daten entscheidet. Sind die Zwecke und Mittel dieser Verarbeitung durch das Unionsrecht oder das Recht der Mitgliedstaaten vorgegeben, so kann der Verantwortliche beziehungsweise k\xf6nnen die bestimmten Kriterien seiner Benennung nach dem Unionsrecht oder dem Recht der Mitgliedstaaten vorgesehen werden.",null,null,null,null,null,null)
B.TR=new A.x("h)    Auftragsverarbeiter",null,null,null,null,null,null)
B.T_=new A.x("Auftragsverarbeiter ist eine nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle, die personenbezogene Daten im Auftrag des Verantwortlichen verarbeitet.",null,null,null,null,null,null)
B.Sq=new A.x("i)    Empf\xe4nger",null,null,null,null,null,null)
B.U9=new A.x("Empf\xe4nger ist eine nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle, der personenbezogene Daten offengelegt werden, unabh\xe4ngig davon, ob es sich bei ihr um einen Dritten handelt oder nicht. Beh\xf6rden, die im Rahmen eines bestimmten Untersuchungsauftrags nach dem Unionsrecht oder dem Recht der Mitgliedstaaten m\xf6glicherweise personenbezogene Daten erhalten, gelten jedoch nicht als Empf\xe4nger.",null,null,null,null,null,null)
B.TN=new A.x("j)    Dritter",null,null,null,null,null,null)
B.UE=new A.x("Dritter ist eine nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle au\xdfer der betroffenen Person, dem Verantwortlichen, dem Auftragsverarbeiter und den Personen, die unter der unmittelbaren Verantwortung des Verantwortlichen oder des Auftragsverarbeiters befugt sind, die personenbezogenen Daten zu verarbeiten.",null,null,null,null,null,null)
B.TS=new A.x("k)    Einwilligung",null,null,null,null,null,null)
B.RP=new A.x("Einwilligung ist jede von der betroffenen Person freiwillig f\xfcr den bestimmten Fall in informierter Weise und unmissverst\xe4ndlich abgegebene Willensbekundung in Form einer Erkl\xe4rung oder einer sonstigen eindeutigen best\xe4tigenden Handlung, mit der die betroffene Person zu verstehen gibt, dass sie mit der Verarbeitung der sie betreffenden personenbezogenen Daten einverstanden ist.",null,null,null,null,null,null)
B.RN=new A.x("2. Name und Anschrift des f\xfcr die Verarbeitung Verantwortlichen",null,null,null,null,null,null)
B.Tb=new A.x("Verantwortlicher im Sinne der Datenschutz-Grundverordnung, sonstiger in den Mitgliedstaaten der Europ\xe4ischen Union geltenden Datenschutzgesetze und anderer Bestimmungen mit datenschutzrechtlichem Charakter ist die:",null,null,null,null,null,null)
B.xg=new A.x("RAUMUNIKATE",null,null,null,null,null,null)
