B.T0=new A.x("3. Cookies",null,null,null,null,null,null)
B.Um=new A.x("Die Internetseiten der Raumunikate Ina Kaiser verwenden Cookies. Cookies sind Textdateien, welche \xfcber einen Internetbrowser auf einem Computersystem abgelegt und gespeichert werden.",null,null,null,null,null,null)
B.RS=new A.x("Zahlreiche Internetseiten und Server verwenden Cookies. Viele Cookies enthalten eine sogenannte Cookie-ID. Eine Cookie-ID ist eine eindeutige Kennung des Cookies. Sie besteht aus einer Zeichenfolge, durch welche Internetseiten und Server dem konkreten Internetbrowser zugeordnet werden k\xf6nnen, in dem das Cookie gespeichert wurde. Dies erm\xf6glicht es den besuchten Internetseiten und Servern, den individuellen Browser der betroffenen Person von anderen Internetbrowsern, die andere Cookies enthalten, zu unterscheiden. Ein bestimmter Internetbrowser kann \xfcber die eindeutige Cookie-ID wiedererkannt und identifiziert werden.",null,null,null,null,null,null)
B.SY=new A.x("Durch den Einsatz von Cookies kann die Raumunikate Ina Kaiser den Nutzern dieser Internetseite nutzerfreundlichere Services bereitstellen, die ohne die Cookie-Setzung nicht m\xf6glich w\xe4ren.",null,null,null,null,null,null)
B.S_=new A.x("Mittels eines Cookies k\xf6nnen die Informationen und Angebote auf unserer Internetseite im Sinne des Benutzers optimiert werden. Cookies erm\xf6glichen uns, wie bereits erw\xe4hnt, die Benutzer unserer Internetseite wiederzuerkennen. Zweck dieser Wiedererkennung ist es, den Nutzern die Verwendung unserer Internetseite zu erleichtern. Der Benutzer einer Internetseite, die Cookies verwendet, muss beispielsweise nicht bei jedem Besuch der Internetseite erneut seine Zugangsdaten eingeben, weil dies von der Internetseite und dem auf dem Computersystem des Benutzers abgelegten Cookie \xfcbernommen wird. Ein weiteres Beispiel ist das Cookie eines Warenkorbes im Online-Shop. Der Online-Shop merkt sich die Artikel, die ein Kunde in den virtuellen Warenkorb gelegt hat, \xfcber ein Cookie.",null,null,null,null,null,null)
B.RH=new A.x("Die betroffene Person kann die Setzung von Cookies durch unsere Internetseite jederzeit mittels einer entsprechenden Einstellung des genutzten Internetbrowsers verhindern und damit der Setzung von Cookies dauerhaft widersprechen. Ferner k\xf6nnen bereits gesetzte Cookies jederzeit \xfcber einen Internetbrowser oder andere Softwareprogramme gel\xf6scht werden. Dies ist in allen g\xe4ngigen Internetbrowsern m\xf6glich. Deaktiviert die betroffene Person die Setzung von Cookies in dem genutzten Internetbrowser, sind unter Umst\xe4nden nicht alle Funktionen unserer Internetseite vollumf\xe4nglich nutzbar.",null,null,null,null,null,null)
B.UK=new A.x("4. Erfassung von allgemeinen Daten und Informationen",null,null,null,null,null,null)
B.TV=new A.x("Die Internetseite der Raumunikate Ina Kaiser erfasst mit jedem Aufruf der Internetseite durch eine betroffene Person oder ein automatisiertes System eine Reihe von allgemeinen Daten und Informationen. Diese allgemeinen Daten und Informationen werden in den Logfiles des Servers gespeichert. Erfasst werden k\xf6nnen die (1) verwendeten Browsertypen und Versionen, (2) das vom zugreifenden System verwendete Betriebssystem, (3) die Internetseite, von welcher ein zugreifendes System auf unsere Internetseite gelangt (sogenannte Referrer), (4) die Unterwebseiten, welche \xfcber ein zugreifendes System auf unserer Internetseite angesteuert werden, (5) das Datum und die Uhrzeit eines Zugriffs auf die Internetseite, (6) eine Internet-Protokoll-Adresse (IP-Adresse), (7) der Internet-Service-Provider des zugreifenden Systems und (8) sonstige \xe4hnliche Daten und Informationen, die der Gefahrenabwehr im Falle von Angriffen auf unsere informationstechnologischen Systeme dienen.",null,null,null,null,null,null)
B.Ur=new A.x("Bei der Nutzung dieser allgemeinen Daten und Informationen zieht die Raumunikate Ina Kaiser keine R\xfcckschl\xfcsse auf die betroffene Person. Diese Informationen werden vielmehr ben\xf6tigt, um (1) die Inhalte unserer Internetseite korrekt auszuliefern, (2) die Inhalte unserer Internetseite sowie die Werbung f\xfcr diese zu optimieren, (3) die dauerhafte Funktionsf\xe4higkeit unserer informationstechnologischen Systeme und der Technik unserer Internetseite zu gew\xe4hrleisten sowie (4) um Strafverfolgungsbeh\xf6rden im Falle eines Cyberangriffes die zur Strafverfolgung notwendigen Informationen bereitzustellen. Diese anonym erhobenen Daten und Informationen werden durch die Raumunikate Ina Kaiser daher einerseits statistisch und ferner mit dem Ziel ausgewertet, den Datenschutz und die Datensicherheit in unserem Unternehmen zu erh\xf6hen, um letztlich ein optimales Schutzniveau f\xfcr die von uns verarbeiteten personenbezogenen Daten sicherzustellen. Die anonymen Daten der Server-Logfiles werden getrennt von allen durch eine betroffene Person angegebenen personenbezogenen Daten gespeichert.",null,null,null,null,null,null)
B.RJ=new A.x("5. Registrierung auf unserer Internetseite",null,null,null,null,null,null)
B.Sm=new A.x("Die betroffene Person hat die M\xf6glichkeit, sich auf der Internetseite des f\xfcr die Verarbeitung Verantwortlichen unter Angabe von personenbezogenen Daten zu registrieren. Welche personenbezogenen Daten dabei an den f\xfcr die Verarbeitung Verantwortlichen \xfcbermittelt werden, ergibt sich aus der jeweiligen Eingabemaske, die f\xfcr die Registrierung verwendet wird. Die von der betroffenen Person eingegebenen personenbezogenen Daten werden ausschlie\xdflich f\xfcr die interne Verwendung bei dem f\xfcr die Verarbeitung Verantwortlichen und f\xfcr eigene Zwecke erhoben und gespeichert. Der f\xfcr die Verarbeitung Verantwortliche kann die Weitergabe an einen oder mehrere Auftragsverarbeiter, beispielsweise einen Paketdienstleister, veranlassen, der die personenbezogenen Daten ebenfalls ausschlie\xdflich f\xfcr eine interne Verwendung, die dem f\xfcr die Verarbeitung Verantwortlichen zuzurechnen ist, nutzt.",null,null,null,null,null,null)
B.UD=new A.x("Durch eine Registrierung auf der Internetseite des f\xfcr die Verarbeitung Verantwortlichen wird ferner die vom Internet-Service-Provider (ISP) der betroffenen Person vergebene IP-Adresse, das Datum sowie die Uhrzeit der Registrierung gespeichert. Die Speicherung dieser Daten erfolgt vor dem Hintergrund, dass nur so der Missbrauch unserer Dienste verhindert werden kann, und diese Daten im Bedarfsfall erm\xf6glichen, begangene Straftaten aufzukl\xe4ren. Insofern ist die Speicherung dieser Daten zur Absicherung des f\xfcr die Verarbeitung Verantwortlichen erforderlich. Eine Weitergabe dieser Daten an Dritte erfolgt grunds\xe4tzlich nicht, sofern keine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe der Strafverfolgung dient.",null,null,null,null,null,null)
B.TE=new A.x("Die Registrierung der betroffenen Person unter freiwilliger Angabe personenbezogener Daten dient dem f\xfcr die Verarbeitung Verantwortlichen dazu, der betroffenen Person Inhalte oder Leistungen anzubieten, die aufgrund der Natur der Sache nur registrierten Benutzern angeboten werden k\xf6nnen. Registrierten Personen steht die M\xf6glichkeit frei, die bei der Registrierung angegebenen personenbezogenen Daten jederzeit abzu\xe4ndern oder vollst\xe4ndig aus dem Datenbestand des f\xfcr die Verarbeitung Verantwortlichen l\xf6schen zu lassen.",null,null,null,null,null,null)
B.TO=new A.x("Der f\xfcr die Verarbeitung Verantwortliche erteilt jeder betroffenen Person jederzeit auf Anfrage Auskunft dar\xfcber, welche personenbezogenen Daten \xfcber die betroffene Person gespeichert sind. Ferner berichtigt oder l\xf6scht der f\xfcr die Verarbeitung Verantwortliche personenbezogene Daten auf Wunsch oder Hinweis der betroffenen Person, soweit dem keine gesetzlichen Aufbewahrungspflichten entgegenstehen. Die Gesamtheit der Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen stehen der betroffenen Person in diesem Zusammenhang als Ansprechpartner zur Verf\xfcgung.",null,null,null,null,null,null)
B.Sg=new A.x("6. Kontaktm\xf6glichkeit \xfcber die Internetseite",null,null,null,null,null,null)
B.UH=new A.x("Die Internetseite der Raumunikate Ina Kaiser enth\xe4lt aufgrund von gesetzlichen Vorschriften Angaben, die eine schnelle elektronische Kontaktaufnahme zu unserem Unternehmen sowie eine unmittelbare Kommunikation mit uns erm\xf6glichen, was ebenfalls eine allgemeine Adresse der sogenannten elektronischen Post (E-Mail-Adresse) umfasst. Sofern eine betroffene Person per E-Mail oder \xfcber ein Kontaktformular den Kontakt mit dem f\xfcr die Verarbeitung Verantwortlichen aufnimmt, werden die von der betroffenen Person \xfcbermittelten personenbezogenen Daten automatisch gespeichert. Solche auf freiwilliger Basis von einer betroffenen Person an den f\xfcr die Verarbeitung Verantwortlichen \xfcbermittelten personenbezogenen Daten werden f\xfcr Zwecke der Bearbeitung oder der Kontaktaufnahme zur betroffenen Person gespeichert. Es erfolgt keine Weitergabe dieser personenbezogenen Daten an Dritte.",null,null,null,null,null,null)
B.S1=new A.x("7. Routinem\xe4\xdfige L\xf6schung und Sperrung von personenbezogenen Daten",null,null,null,null,null,null)
B.Tn=new A.x("Der f\xfcr die Verarbeitung Verantwortliche verarbeitet und speichert personenbezogene Daten der betroffenen Person nur f\xfcr den Zeitraum, der zur Erreichung des Speicherungszwecks erforderlich ist oder sofern dies durch den Europ\xe4ischen Richtlinien- und Verordnungsgeber oder einen anderen Gesetzgeber in Gesetzen oder Vorschriften, welchen der f\xfcr die Verarbeitung Verantwortliche unterliegt, vorgesehen wurde.",null,null,null,null,null,null)
B.Sx=new A.x("Entf\xe4llt der Speicherungszweck oder l\xe4uft eine vom Europ\xe4ischen Richtlinien- und Verordnungsgeber oder einem anderen zust\xe4ndigen Gesetzgeber vorgeschriebene Speicherfrist ab, werden die personenbezogenen Daten routinem\xe4\xdfig und entsprechend den gesetzlichen Vorschriften gesperrt oder gel\xf6scht.",null,null,null,null,null,null)
B.Sr=new A.x("8. Rechte der betroffenen Person",null,null,null,null,null,null)
B.RB=new A.x("a)    Recht auf Best\xe4tigung",null,null,null,null,null,null)
B.TD=new A.x("Jede betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber einger\xe4umte Recht, von dem f\xfcr die Verarbeitung Verantwortlichen eine Best\xe4tigung dar\xfcber zu verlangen, ob sie betreffende personenbezogene Daten verarbeitet werden. M\xf6chte eine betroffene Person dieses Best\xe4tigungsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null)
B.RK=new A.x("b)    Recht auf Auskunft",null,null,null,null,null,null)
B.Se=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, jederzeit von dem f\xfcr die Verarbeitung Verantwortlichen unentgeltliche Auskunft \xfcber die zu seiner Person gespeicherten personenbezogenen Daten und eine Kopie dieser Auskunft zu erhalten. Ferner hat der Europ\xe4ische Richtlinien- und Verordnungsgeber der betroffenen Person Auskunft \xfcber folgende Informationen zugestanden:",null,null,null,null,null,null)
B.UP=new A.x("- die Verarbeitungszwecke",null,null,null,null,null,null)
B.SS=new A.x("- die Kategorien personenbezogener Daten, die verarbeitet werden",null,null,null,null,null,null)
B.UN=new A.x("- die Empf\xe4nger oder Kategorien von Empf\xe4ngern, gegen\xfcber denen die personenbezogenen Daten offengelegt worden sind oder noch offengelegt werden, insbesondere bei Empf\xe4ngern in Drittl\xe4ndern oder bei internationalen Organisationen",null,null,null,null,null,null)
B.SN=new A.x("- falls m\xf6glich die geplante Dauer, f\xfcr die die personenbezogenen Daten gespeichert werden, oder, falls dies nicht m\xf6glich ist, die Kriterien f\xfcr die Festlegung dieser Dauer",null,null,null,null,null,null)
B.SP=new A.x("- das Bestehen eines Rechts auf Berichtigung oder L\xf6schung der sie betreffenden personenbezogenen Daten oder auf Einschr\xe4nkung der Verarbeitung durch den Verantwortlichen oder eines Widerspruchsrechts gegen diese Verarbeitung",null,null,null,null,null,null)
