B.SX=new A.x("Ferner steht der betroffenen Person ein Auskunftsrecht dar\xfcber zu, ob personenbezogene Daten an ein Drittland oder an eine internationale Organisation \xfcbermittelt wurden. Sofern dies der Fall ist, so steht der betroffenen Person im \xdcbrigen das Recht zu, Auskunft \xfcber die geeigneten Garantien im Zusammenhang mit der \xdcbermittlung zu erhalten. M\xf6chte eine betroffene Person dieses Auskunftsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null)
