B.Uw=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, die unverz\xfcgliche Berichtigung sie betreffender unrichtiger personenbezogener Daten zu verlangen. Ferner steht der betroffenen Person das Recht zu, unter Ber\xfccksichtigung der Zwecke der Verarbeitung, die Vervollst\xe4ndigung unvollst\xe4ndiger personenbezogener Daten \u2014 auch mittels einer erg\xe4nzenden Erkl\xe4rung \u2014 zu verlangen.",null,null,null,null,null,null)
