B.SV=new A.x("- Die betroffene Person legt gem\xe4\xdf Art. 21 Abs. 1 DS-GVO Widerspruch gegen die Verarbeitung ein, und es liegen keine vorrangigen berechtigten Gr\xfcnde f\xfcr die Verarbeitung vor, oder die betroffene Person legt gem\xe4\xdf Art. 21 Abs. 2 DS-GVO Widerspruch gegen die Verarbeitung ein.",null,null,null,null,null,null)
B.UJ=new A.x("- Die personenbezogenen Daten wurden unrechtm\xe4\xdfig verarbeitet.",null,null,null,null,null,null)
B.RI=new A.x("- Die L\xf6schung der personenbezogenen Daten ist zur Erf\xfcllung einer rechtlichen Verpflichtung nach dem Unionsrecht oder dem Recht der Mitgliedstaaten erforderlich, dem der Verantwortliche unterliegt.",null,null,null,null,null,null)
B.RM=new A.x("- Die personenbezogenen Daten wurden in Bezug auf angebotene Dienste der Informationsgesellschaft gem\xe4\xdf Art. 8 Abs. 1 DS-GVO erhoben.",null,null,null,null,null,null)
B.UB=new A.x("Sofern einer der oben genannten Gr\xfcnde zutrifft und eine betroffene Person die L\xf6schung von personenbezogenen Daten, die bei der Raumunikate Ina Kaiser gespeichert sind, veranlassen m\xf6chte, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden. Der Mitarbeiter der Raumunikate Ina Kaiser wird veranlassen, dass dem L\xf6schverlangen unverz\xfcglich nachgekommen wird. Wurden die personenbezogenen Daten von der Raumunikate Ina Kaiser \xf6ffentlich gemacht und ist unser Unternehmen als Verantwortlicher gem\xe4\xdf Art. 17 Abs. 1 DS-GVO zur L\xf6schung der personenbezogenen Daten verpflichtet, so trifft die Raumunikate Ina Kaiser unter Ber\xfccksichtigung der verf\xfcgbaren Technologie und der Implementierungskosten angemessene Ma\xdfnahmen, auch technischer Art, um andere f\xfcr die Datenverarbeitung Verantwortliche, welche die ver\xf6ffentlichten personenbezogenen Daten verarbeiten, dar\xfcber in Kenntnis zu setzen, dass die betroffene Person von diesen anderen f\xfcr die Datenverarbeitung Verantwortlichen die L\xf6schung s\xe4mtlicher Links zu diesen personenbezogenen Daten oder von Kopien oder Replikationen dieser personenbezogenen Daten verlangt hat, soweit die Verarbeitung nicht erforderlich ist. Der Mitarbeiter der Raumunikate Ina Kaiser wird im Einzelfall das Notwendige veranlassen.",null,null,null,null,null,null)
B.SC=new A.x("e)    Recht auf Einschr\xe4nkung der Verarbeitung",null,null,null,null,null,null)
