B.TC=new A.x("- Die Richtigkeit der personenbezogenen Daten wird von der betroffenen Person bestritten, und zwar f\xfcr eine Dauer, die es dem Verantwortlichen erm\xf6glicht, die Richtigkeit der personenbezogenen Daten zu \xfcberpr\xfcfen.",null,null,null,null,null,null)
B.Uo=new A.x("- Die Verarbeitung ist unrechtm\xe4\xdfig, die betroffene Person lehnt die L\xf6schung der personenbezogenen Daten ab und verlangt stattdessen die Einschr\xe4nkung der Nutzung der personenbezogenen Daten.",null,null,null,null,null,null)
B.Sf=new A.x("- Der Verantwortliche ben\xf6tigt die personenbezogenen Daten f\xfcr die Zwecke der Verarbeitung nicht l\xe4nger, die betroffene Person ben\xf6tigt sie jedoch zur Geltendmachung, Aus\xfcbung oder Verteidigung von Rechtsanspr\xfcchen.",null,null,null,null,null,null)
B.ST=new A.x("- Die betroffene Person hat Widerspruch gegen die Verarbeitung gem. Art. 21 Abs. 1 DS-GVO eingelegt und es steht noch nicht fest, ob die berechtigten Gr\xfcnde des Verantwortlichen gegen\xfcber denen der betroffenen Person \xfcberwiegen.",null,null,null,null,null,null)
B.Tu=new A.x("Sofern eine der oben genannten Voraussetzungen gegeben ist und eine betroffene Person die Einschr\xe4nkung von personenbezogenen Daten, die bei der Raumunikate Ina Kaiser gespeichert sind, verlangen m\xf6chte, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden. Der Mitarbeiter der Raumunikate Ina Kaiser wird die Einschr\xe4nkung der Verarbeitung veranlassen.",null,null,null,null,null,null)
