B.RA=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, die sie betreffenden personenbezogenen Daten, welche durch die betroffene Person einem Verantwortlichen bereitgestellt wurden, in einem strukturierten, g\xe4ngigen und maschinenlesbaren Format zu erhalten. Sie hat au\xdferdem das Recht, diese Daten einem anderen Verantwortlichen ohne Behinderung durch den Verantwortlichen, dem die personenbezogenen Daten bereitgestellt wurden, zu \xfcbermitteln, sofern die Verarbeitung auf der Einwilligung gem\xe4\xdf Art. 6 Abs. 1 Buchstabe a DS-GVO oder Art. 9 Abs. 2 Buchstabe a DS-GVO oder auf einem Vertrag gem\xe4\xdf Art. 6 Abs. 1 Buchstabe b DS-GVO beruht und die Verarbeitung mithilfe automatisierter Verfahren erfolgt, sofern die Verarbeitung nicht f\xfcr die Wahrnehmung einer Aufgabe erforderlich ist, die im \xf6ffentlichen Interesse liegt oder in Aus\xfcbung \xf6ffentlicher Gewalt erfolgt, welche dem Verantwortlichen \xfcbertragen wurde.",null,null,null,null,null,null)
B.Tt=new A.x("Ferner hat die betroffene Person bei der Aus\xfcbung ihres Rechts auf Daten\xfcbertragbarkeit gem\xe4\xdf Art. 20 Abs. 1 DS-GVO das Recht, zu erwirken, dass die personenbezogenen Daten direkt von einem Verantwortlichen an einen anderen Verantwortlichen \xfcbermittelt werden, soweit dies technisch machbar ist und sofern hiervon nicht die Rechte und Freiheiten anderer Personen beeintr\xe4chtigt werden.",null,null,null,null,null,null)
B.Ux=new A.x("Zur Geltendmachung des Rechts auf Daten\xfcbertragbarkeit kann sich die betroffene Person jederzeit an einen Mitarbeiter der Raumunikate Ina Kaiser wenden.",null,null,null,null,null,null)
B.Sd=new A.x("g)    Recht auf Widerspruch",null,null,null,null,null,null)
B.SQ=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, aus Gr\xfcnden, die sich aus ihrer besonderen Situation ergeben, jederzeit gegen die Verarbeitung sie betreffender personenbezogener Daten, die aufgrund von Art. 6 Abs. 1 Buchstaben e oder f DS-GVO erfolgt, Widerspruch einzulegen. Dies gilt auch f\xfcr ein auf diese Bestimmungen gest\xfctztes Profiling.",null,null,null,null,null,null)
B.Sw=new A.x("Die Raumunikate Ina Kaiser verarbeitet die personenbezogenen Daten im Falle des Widerspruchs nicht mehr, es sei denn, wir k\xf6nnen zwingende schutzw\xfcrdige Gr\xfcnde f\xfcr die Verarbeitung nachweisen, die den Interessen, Rechten und Freiheiten der betroffenen Person \xfcberwiegen, oder die Verarbeitung dient der Geltendmachung, Aus\xfcbung oder Verteidigung von Rechtsanspr\xfcchen.",null,null,null,null,null,null)
B.Sc=new A.x("Verarbeitet die Raumunikate Ina Kaiser personenbezogene Daten, um Direktwerbung zu betreiben, so hat die betroffene Person das Recht, jederzeit Widerspruch gegen die Verarbeitung der personenbezogenen Daten zum Zwecke derartiger Werbung einzulegen. Dies gilt auch f\xfcr das Profiling, soweit es mit solcher Direktwerbung in Verbindung steht. Widerspricht die betroffene Person gegen\xfcber der Raumunikate Ina Kaiser der Verarbeitung f\xfcr Zwecke der Direktwerbung, so wird die Raumunikate Ina Kaiser die personenbezogenen Daten nicht mehr f\xfcr diese Zwecke verarbeiten.",null,null,null,null,null,null)
B.TY=new A.x("Zudem hat die betroffene Person das Recht, aus Gr\xfcnden, die sich aus ihrer besonderen Situation ergeben, gegen die sie betreffende Verarbeitung personenbezogener Daten, die bei der Raumunikate Ina Kaiser zu wissenschaftlichen oder historischen Forschungszwecken oder zu statistischen Zwecken gem\xe4\xdf Art. 89 Abs. 1 DS-GVO erfolgen, Widerspruch einzulegen, es sei denn, eine solche Verarbeitung ist zur Erf\xfcllung einer im \xf6ffentlichen Interesse liegenden Aufgabe erforderlich.",null,null,null,null,null,null)
B.Rw=new A.x("Zur Aus\xfcbung des Rechts auf Widerspruch kann sich die betroffene Person direkt an jeden Mitarbeiter der Raumunikate Ina Kaiser oder einen anderen Mitarbeiter wenden. Der betroffenen Person steht es ferner frei, im Zusammenhang mit der Nutzung von Diensten der Informationsgesellschaft, ungeachtet der Richtlinie 2002/58/EG, ihr Widerspruchsrecht mittels automatisierter Verfahren auszu\xfcben, bei denen technische Spezifikationen verwendet werden.",null,null,null,null,null,null)
B.Tk=new A.x("h)    Automatisierte Entscheidungen im Einzelfall einschlie\xdflich Profiling",null,null,null,null,null,null)
B.Uy=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, nicht einer ausschlie\xdflich auf einer automatisierten Verarbeitung \u2014 einschlie\xdflich Profiling \u2014 beruhenden Entscheidung unterworfen zu werden, die ihr gegen\xfcber rechtliche Wirkung entfaltet oder sie in \xe4hnlicher Weise erheblich beeintr\xe4chtigt, sofern die Entscheidung (1) nicht f\xfcr den Abschluss oder die Erf\xfcllung eines Vertrags zwischen der betroffenen Person und dem Verantwortlichen erforderlich ist, oder (2) aufgrund von Rechtsvorschriften der Union oder der Mitgliedstaaten, denen der Verantwortliche unterliegt, zul\xe4ssig ist und diese Rechtsvorschriften angemessene Ma\xdfnahmen zur Wahrung der Rechte und Freiheiten sowie der berechtigten Interessen der betroffenen Person enthalten oder (3) mit ausdr\xfccklicher Einwilligung der betroffenen Person erfolgt.",null,null,null,null,null,null)
B.Up=new A.x("Ist die Entscheidung (1) f\xfcr den Abschluss oder die Erf\xfcllung eines Vertrags zwischen der betroffenen Person und dem Verantwortlichen erforderlich oder (2) erfolgt sie mit ausdr\xfccklicher Einwilligung der betroffenen Person, trifft die Raumunikate Ina Kaiser angemessene Ma\xdfnahmen, um die Rechte und Freiheiten sowie die berechtigten Interessen der betroffenen Person zu wahren, wozu mindestens das Recht auf Erwirkung des Eingreifens einer Person seitens des Verantwortlichen, auf Darlegung des eigenen Standpunkts und auf Anfechtung der Entscheidung geh\xf6rt.",null,null,null,null,null,null)
