B.SR=new A.x("9. Datenschutzbestimmungen zu Einsatz und Verwendung von Facebook",null,null,null,null,null,null)
B.T5=new A.x("Der f\xfcr die Verarbeitung Verantwortliche hat auf dieser Internetseite Komponenten des Unternehmens Facebook integriert. Facebook ist ein soziales Netzwerk.",null,null,null,null,null,null)
B.Un=new A.x("Ein soziales Netzwerk ist ein im Internet betriebener sozialer Treffpunkt, eine Online-Gemeinschaft, die es den Nutzern in der Regel erm\xf6glicht, untereinander zu kommunizieren und im virtuellen Raum zu interagieren. Ein soziales Netzwerk kann als Plattform zum Austausch von Meinungen und Erfahrungen dienen oder erm\xf6glicht es der Internetgemeinschaft, pers\xf6nliche oder unternehmensbezogene Informationen bereitzustellen. Facebook erm\xf6glicht den Nutzern des sozialen Netzwerkes unter anderem die Erstellung von privaten Profilen, den Upload von Fotos und eine Vernetzung \xfcber Freundschaftsanfragen.",null,null,null,null,null,null)
B.Si=new A.x("Betreibergesellschaft von Facebook ist die Facebook, Inc., 1 Hacker Way, Menlo Park, CA 94025, USA. F\xfcr die Verarbeitung personenbezogener Daten Verantwortlicher ist, wenn eine betroffene Person au\xdferhalb der USA oder Kanada lebt, die Facebook Ireland Ltd., 4 Grand Canal Square, Grand Canal Harbour, Dublin 2, Ireland.",null,null,null,null,null,null)
B.RX=new A.x("Durch jeden Aufruf einer der Einzelseiten dieser Internetseite, die durch den f\xfcr die Verarbeitung Verantwortlichen betrieben wird und auf welcher eine Facebook-Komponente (Facebook-Plug-In) integriert wurde, wird der Internetbrowser auf dem informationstechnologischen System der betroffenen Person automatisch durch die jeweilige Facebook-Komponente veranlasst, eine Darstellung der entsprechenden Facebook-Komponente von Facebook herunterzuladen. Eine Gesamt\xfcbersicht \xfcber alle Facebook-Plug-Ins kann unter https://developers.facebook.com/docs/plugins/?locale=de_DE abgerufen werden. Im Rahmen dieses technischen Verfahrens erh\xe4lt Facebook Kenntnis dar\xfcber, welche konkrete Unterseite unserer Internetseite durch die betroffene Person besucht wird.",null,null,null,null,null,null)
B.Td=new A.x('Sofern die betroffene Person gleichzeitig bei Facebook eingeloggt ist, erkennt Facebook mit jedem Aufruf unserer Internetseite durch die betroffene Person und w\xe4hrend der gesamten Dauer des jeweiligen Aufenthaltes auf unserer Internetseite, welche konkrete Unterseite unserer Internetseite die betroffene Person besucht. Diese Informationen werden durch die Facebook-Komponente gesammelt und durch Facebook dem jeweiligen Facebook-Account der betroffenen Person zugeordnet. Bet\xe4tigt die betroffene Person einen der auf unserer Internetseite integrierten Facebook-Buttons, beispielsweise den "Gef\xe4llt mir"-Button, oder gibt die betroffene Person einen Kommentar ab, ordnet Facebook diese Information dem pers\xf6nlichen Facebook-Benutzerkonto der betroffenen Person zu und speichert diese personenbezogenen Daten.',null,null,null,null,null,null)
B.TI=new A.x("Facebook erh\xe4lt \xfcber die Facebook-Komponente immer dann eine Information dar\xfcber, dass die betroffene Person unsere Internetseite besucht hat, wenn die betroffene Person zum Zeitpunkt des Aufrufs unserer Internetseite gleichzeitig bei Facebook eingeloggt ist; dies findet unabh\xe4ngig davon statt, ob die betroffene Person die Facebook-Komponente anklickt oder nicht. Ist eine derartige \xdcbermittlung dieser Informationen an Facebook von der betroffenen Person nicht gewollt, kann diese die \xdcbermittlung dadurch verhindern, dass sie sich vor einem Aufruf unserer Internetseite aus ihrem Facebook-Account ausloggt.",null,null,null,null,null,null)
