B.Dx=new A.bh(" abrufbar ist, gibt Aufschluss \xfcber die Erhebung, Verarbeitung und Nutzung personenbezogener Daten durch Facebook. Ferner wird dort erl\xe4utert, welche Einstellungsm\xf6glichkeiten Facebook zum Schutz der Privatsph\xe4re der betroffenen Person bietet. Zudem sind unterschiedliche Applikationen erh\xe4ltlich, die es erm\xf6glichen, eine Daten\xfcbermittlung an Facebook zu unterdr\xfccken. Solche Applikationen k\xf6nnen durch die betroffene Person genutzt werden, um eine Daten\xfcbermittlung an Facebook zu unterdr\xfccken.",null)
