B.WO=new A.fy("Bitte erz\xe4hle uns etwas \xfcber Dich und Dein Zuhause.",null)
B.az=new A.dh(null,8,null,null)
B.UI=new A.x('Ich bin Lilli, 39 Jahre alt und arbeite bei einem der letzten familiengef\xfchrten M\xf6belunternehmen in Deutschland. Ich denke gerne kreativ und mag es grenzen\xfcbergreifende Strategien zu entwickeln. Wir, das sind mein Mann, unsere beiden T\xf6chter und ich, leben in Bielefeld in einem historischem Gewerbepark in einem Loft auf 100 Quadratmetern. Es ist alles offen, bis auf das Zimmer unserer gro\xdfen Tochter. Wir lieben die H\xf6he in der Mitte des Raums, die f\xfcr viel "Freiheit" sorgt. Es gibt aber auch auf der ganzen Rauml\xe4nge auf beiden Seiten Dachschr\xe4gen, die dem Raum kuschelige Gem\xfctlichkeit verleihen. Lange (10 Jahre) haben wir davon getr\xe4umt so zu wohnen und sind jetzt mega happy.',null,null,null,null,null,null)
B.WH=new A.fy("Welche Aspekte verleihen Deinem Zuhause Wohlf\xfchlatmosph\xe4re?",null)
B.Sk=new A.x('F\xfcr uns bedeutet Wohlf\xfchlatmosph\xe4re Luft zum Atmen, daher ist die Raummitte frei, um mit Leben bespielt zu werden. Wir haben wenig M\xf6bel \u2013 die alle funktional und mit viel Liebe ausgew\xe4hlt sind - aber einige sch\xf6ne, farbenfrohe Wohnaccessoires und Objekte, die unser Zuhause "besonders" machen. Ich mag es, wenn man sieht, wer darin wohnt.',null,null,null,null,null,null)
B.WK=new A.fy("Wie gehst Du an Raumgestaltung heran?",null)
B.T9=new A.x("Ich richte selten R\xe4ume ein. In unserem Loft wohnen wir jetzt schon fast 10 Jahre und hier hat sich in der groben Struktur wenig getan. Am Anfang haben wir den Raum nach unseren Bed\xfcrfnissen und Needs in Bereiche geordnet und geschaut welche M\xf6bel wir wo platzieren. Die Gliederung sollte einen Rahmen geben, aber die Leichtigkeit und Offenheit des Raums nicht kaputt zu machen. Ein Bad, eine K\xfcche, ein Esstisch mit St\xfchlen, Bett und Schrank, ein niedriges Regal passend zu unserer Architektur. Es gibt bei uns wenig M\xf6glichkeiten M\xf6bel zu verr\xfccken oder Bereiche zu tauschen. Ich glaube wir haben f\xfcr unsere Wohnsituation mit den Anforderungen von vier Personen die beste L\xf6sung gefunden.",null,null,null,null,null,null)
B.WL=new A.fy("Was darf in einem Raum f\xfcr Dich nicht fehlen?",null)
B.TH=new A.x("Die pers\xf6nliche Note. Ich mag es, wenn ein Zuhause individuell ist, w\xe4chst, sich ver\xe4ndert und Geschichten \xfcber die Bewohner erz\xe4hlt. Es muss niemandem gefallen, au\xdfer den Menschen, die darin zuhause sind. Ich pers\xf6nlich mag Farbe sehr. Die bringt Fr\xf6hlichkeit in jeden Raum und tut meinem Wohlbefinden gut.",null,null,null,null,null,null)
B.G7=A.a(s(["images/blog/0/child.jpg","images/blog/0/eat.jpg","images/blog/0/sleep2.jpg"]),t.s)
B.Xf=new A.BU(B.G7,null)
B.WI=new A.fy("Welche Rolle spielt Raumfarbe f\xfcr Dich?",null)
B.Sa=new A.x("Wie eben schon erw\xe4hnt: Ich liebe Farbe! Aaaaaber unser Boden ist lichtgrau und unsere W\xe4nde sind fast \xfcberall wei\xdf. Die einzige farbige Wand, findet man bei uns im Bad. Die wei\xdfen W\xe4nde und der lichtgraue Holzboden bieten aber unseren farbenfrohen Dekoaccessoires, Designobjekten und der Kunst an der Wand die perfekte B\xfchne. So k\xf6nnen besondere St\xfccke mehr Aufmerksamkeit auf sich ziehen. Au\xdferdem wird durch die Farb-Unterbrechung ein harmonisches Gleichgewicht zwischen Ruhe und Spannung gehalten.",null,null,null,null,null,null)
B.WN=new A.fy("Du wohnst nicht allein. Wie bekommst Du alle W\xfcnsche unter einen Hut?",null)
B.U2=new A.x('Jeder darf seine W\xfcnsche \xe4u\xdfern. Damit es am Ende nicht zu wild wird \u2013 bei uns sind ja (fast) alle Bereiche auf einen Blick einsehbar - geben wir unseren T\xf6chtern gerne eine Auswahl vor und lenken so in die "richtige" Richtung. Im Zimmer unserer Gro\xdfen, hat sie nat\xfcrlich den Hut auf und die Kleine darf sich in ihren Tiny-Kinderhaus ausleben. Die gro\xdfen Einrichtungsentscheidungen liegen zu 50% bei meinem Mann Sascha und zu 50% bei mir. Wir k\xf6nnen uns da gut die B\xe4lle zuspielen und finden immer einen guten Kompromiss. W\xfcrde ich allein entscheiden, w\xe4re es wahrscheinlich weicher, femininer - w\xfcrde er alleine entscheiden w\xe4re es artify, verr\xfcckter und vielleicht minimalistischer. So wie es ist, k\xf6nnen wir beide sehr gut damit leben. :)',null,null,null,null,null,null)
B.WM=new A.fy("Welches ist Dein Lieblingsst\xfcck und warum?",null)
B.RT=new A.x("Ich habe ehrlich gesagt kein Lieblingsst\xfcck, ich h\xe4nge nicht an Dingen. Wenn Sascha einen neuen Tisch baut, darf der alte gehen und in einer anderen Familie zum Lebensmittelpunkt werden, das ist ein sch\xf6ner Fluss. Wir entwerfen gerne neue Dinge, probieren aus und lassen sie irgendwann weiterziehen. Generell m\xf6gen wir spannende Produkte feiner kleiner Labels und langlebige Produkte, auf die wir auch gerne sparen.",null,null,null,null,null,null)
B.WG=new A.fy("Wo findest Du Inspiration?",null)
